--
-- Name: acl_delete_cascade(); Type: FUNCTION; Schema: public; Owner: yala_apps
--

CREATE FUNCTION acl_delete_cascade() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
	EXECUTE ('
		DELETE FROM ' || TG_ARGV[0] || '_acl WHERE object_id=' || OLD.id || ';
	');
RETURN OLD;
END;
$$;


ALTER FUNCTION public.acl_delete_cascade() OWNER TO yala_apps;

--
-- Name: acl_has_right(name, integer, character varying); Type: FUNCTION; Schema: public; Owner: yala_apps
--

CREATE FUNCTION acl_has_right(name, integer, character varying) RETURNS boolean
    LANGUAGE sql
    AS $_$
	SELECT acl_has_right($1, $2, $3, replace(CURRENT_USER, CURRENT_DATABASE() || '_', ''));
$_$;


ALTER FUNCTION public.acl_has_right(name, integer, character varying) OWNER TO yala_apps;

--
-- Name: acl_has_right(name, integer, character varying, name); Type: FUNCTION; Schema: public; Owner: yala_apps
--

CREATE FUNCTION acl_has_right(name, integer, character varying, name) RETURNS boolean
    LANGUAGE plpgsql
    AS $_$
DECLARE
	result Boolean;
BEGIN
	SELECT INTO result usesuper FROM pg_user WHERE usename IN ($4);

	IF result THEN
		RETURN true;
	END IF;

	FOR result IN EXECUTE 'SELECT _' || $3 || ' FROM ' || $1 || '_acl WHERE object_id IN (0, ' || $2 || ') AND username IN (''*'', ''' || CURRENT_DATABASE() || '_' || $4 || ''') ORDER BY _' || $3 || ' DESC LIMIT 1' LOOP END LOOP;


	RETURN COALESCE(result, FALSE);
END;
$_$;


ALTER FUNCTION public.acl_has_right(name, integer, character varying, name) OWNER TO yala_apps;

--
-- Name: acl_insert_cascade(); Type: FUNCTION; Schema: public; Owner: yala_apps
--

CREATE FUNCTION acl_insert_cascade() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
	EXECUTE ('
                SELECT ' || NEW.id || '
                WHERE NOT acl_has_right(''' || TG_ARGV[0] || ''',' || NEW.id || ',''update'');
	');
RETURN OLD;
END;
$$;


ALTER FUNCTION public.acl_insert_cascade() OWNER TO yala_apps;

