CREATE FUNCTION acl_table_delete() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
UPDATE acl SET updated=CURRENT_TIMESTAMP WHERE id IN
    (SELECT id FROM acl WHERE id<>OLD.id AND table_name=OLD.table_name LIMIT 1);
RETURN OLD;
END;
$$;


