--

CREATE FUNCTION delete_user(character varying) RETURNS integer
    LANGUAGE plpgsql
    AS $_$
DECLARE
	result Integer;
BEGIN
	SELECT INTO result id FROM users WHERE username = $1;

	EXECUTE E'DROP USER "' || CURRENT_DATABASE() || '_' || $1 || '"';
	DELETE FROM users WHERE username = $1;

	RETURN result;
END;
$_$;


