CREATE FUNCTION drop_acl_table(name) RETURNS name
    LANGUAGE plpgsql
    AS $_$
BEGIN
	EXECUTE('
		DROP TABLE IF EXISTS ' || $1 || '_acl CASCADE; 
		DROP RULE IF EXISTS ' || $1 || '_delete ON ' || $1 || ';	
		DROP RULE IF EXISTS ' || $1 || '_update ON ' || $1 || ';
