--
-- Name: get_empty_seats(integer); Type: FUNCTION; Schema: public; Owner: yala_apps
--

CREATE FUNCTION get_empty_seats(integer) RETURNS integer
    LANGUAGE plpgsql
    AS $_$
BEGIN
	RETURN (
        SELECT COALESCE(MIN(rooms.available_space), 0)
        FROM course_units
        INNER JOIN lessons ON lessons.course_unit_id = course_units.id
        INNER JOIN rooms ON rooms.id = lessons.room_id
        WHERE course_units.course_id = $1
    ) - (
        SELECT COUNT(*)
        FROM group_users
        INNER JOIN courses ON courses.group_id = group_users.group_id
        WHERE courses.id = $1
    );
END;
$_$;


ALTER FUNCTION public.get_empty_seats(integer) OWNER TO yala_apps;

--
-- Name: update_password(character varying, character varying, boolean); Type: FUNCTION; Schema: public; Owner: yala_apps
--

CREATE FUNCTION update_password(character varying, character varying, boolean) RETURNS integer
    LANGUAGE plpgsql
    AS $_$
DECLARE
	show_plain_password ALIAS FOR $3;
	result Integer;
	pass Varchar;
BEGIN
	EXECUTE E'ALTER USER "' || CURRENT_DATABASE() || '_' || $1 || '" ENCRYPTED PASSWORD ''' || $2 || '''';

	pass = NULL;
	IF show_plain_password THEN
		pass = $2;
	END IF;

	UPDATE users SET plain_password = pass WHERE username = $1;
	SELECT INTO result id FROM users WHERE username = $1;

	RETURN result;

END;
$_$;


ALTER FUNCTION public.update_password(character varying, character varying, boolean) OWNER TO yala_apps;

